import WordEditor from "./WordEditor";
import React from "react";
import { v4 as uuidV4 } from "uuid";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate,
} from "react-router-dom";
// Switch > Routes
//Redirect > Navigate

function App() {

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          //element={<a href={`/documents/${uuidV4()}`}>create document</a>}
          element={<a href={`/documents/${uuidV4()}`}><button class="button red">Create Document</button></a>}/>
        <Route path="/documents/:id" element={<WordEditor />} />
      </Routes>
      <div>
      <button type="button" class="button.red">Join Room by ID</button>
      </div>
    </Router>
    
  );
}

export default App;
